import React from 'react'

const HomeSectonCard =()=> {
    return(
        <div className='cursor-pointer flex flex-col item center bg-white rounded-lg shadow-lg overflow-hidden w-[16rem] mx-3' >
            <div className='h-[13rem] w-[10rem]'>
                <img className='object-cover object-top w-full h-full' src="https://i.pinimg.com/originals/5b/2c/ae/5b2caeb97092c086a8767b928c679d18.jpg" alt=""/>

            </div>
            <div className='p-4'>
                <h3 className='text-lg front-medium text-grey-900 middle'>yellow</h3>
                <p className='mt-2 text-sm text-grey-500'>stipe shirt for mens with less hair manus</p>
            </div>
        </div>
    )
}
export default HomeSectonCard;
